import './App.css';
import React, { useState, useEffect } from 'react';
import Menu from './pageComponents/menu/MenuComponent.js'
import Banner from './bannerComponent/banner/BannerComponent.js'
import Item from './pageComponents/item/ItemComponent.js'
import ItemBest from './pageComponents/itembest/ItemBest.js'
import JourneyComponent from './pageComponents/journey/JourneyComponent.js'
import MissionComponent from './pageComponents/mission/MissionComponent.js'
import FooterComponent from './footerComponent/footer/FooterComponent'
import ItemDetailComponent from './detailComponents/ItemDetailComponent/ItemDetailComponent'
import ItemBuyComponent from './buyComponents/itemBuy/ItemBuy.js'
import { Container } from "reactstrap"
import axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {

  const[listItemFashion,setListItem] = useState([]); 

    useEffect(() => {
        axios.get("http://localhost:3000/bag").then(res => {
            setListItem(res.data);
            console.log(res.data);
        }).catch(err => console.log(err))
    },[listItemFashion])

  return(
    <Container fluid={true}  className="p-0 m-0">
        <div>
          <Menu />
          <Banner />
          <Item />
          <ItemBest />
          <Item listItem={listItemFashion}/>
          <Item listItem={listItemFashion}/>
          <JourneyComponent />
          <Item listItem={listItemFashion}/>
          <MissionComponent />
          <Item />
          <FooterComponent />
        </div>
        {/* <ItemDetailComponent /> */}
        {/* <ItemBuyComponent /> */}
    </Container>
  );
}

export default App;
